the 15 sec mark I hear something although it is hard to make out. It could
possibly be STIFF..  Can&#39;t be sure though.  As for the longer 2nd clip I can
really only hear the whisper that says YES right before you state &quot;you&#39;re
gonna go now&quot;. I know there was someone trying to communicate because there
were a couple times I heard something but it was indiscernible to me.  

